import base64

num = 0
count = 0
cipher_b64 = b""

cipher = base64.b64decode(cipher_b64).decode().split(",")


def x(num):
    if num > 1:
        for i in range(2, num):
            if (num % i) == 0:
                return False
                break
        return True
    else:
        return False


def z(num):
    return (2 ** num) - 1


print("flag{", end="")

while count < len(cipher):
    if x(z(num)):
        print(chr(int(cipher[count]) ^ z(num)), end="", flush=True)
        count += 1
    num += 1

print("}")
